  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0110791 includes discrete
  sample and profile data collected from ROGER REVELLE in the Bay of Bengal and Indian
  Ocean from 2007-03-22 to 2007-05-01. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Chromophoric Dissolved
  Organic Matter (CDOM), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC
  PRESSURE, NEON, NITRATE, NITRITE, Potential temperature (theta), SALINITY, TOTAL
  ALKALINITY (TA), Total Dissolved Nitrogen (TDN), Tritium (Hydrogen isotope), WATER
  TEMPERATURE, pH, phosphate and silicate. The instruments used to collect these data
  include Alkalinity titrator, CTD, Coulometer for DIC measurement, bottle and spectrophotometer.nnThese
  data were collected by Frank J. Millero of Rosenstiel School of Marine and Atmospheric
  Science and Richard A. Feely and Christopher Sabine of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory as part of the CLIVAR I09N_2007 data set. CDIAC
  associated the following cruise ID(s) with this data set: CLIVAR I09N_2007nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
